import React from "react";
import "./dash.css";

function Table({ data }) {
  return (
    <table className="table">
      <thead>
        <tr>
          <th>الاسم</th>
          <th>الدور</th>
        </tr>
      </thead>
      <tbody>
        {data.map((item, index) => (
          <tr key={index}>
            <td>{item.name}</td>
            <td>{item.role}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}

export default Table;
